import { Component, OnInit } from '@angular/core';
import { DomSanitizer, SafeStyle } from '@angular/platform-browser';

@Component({
  selector: 'fd-profile-image',
  templateUrl: './profile-image.component.html',
  styleUrls: ['./profile-image.component.scss']
})
export class ProfileImageComponent implements OnInit {

  private profileImage: SafeStyle;
  private base64Image: string;

  constructor(private sanitizer: DomSanitizer) {

    //TODO: delete hardcoding
    this.base64Image =
    "";

    this.profileImage = this.createProfileImage(this.base64Image);
  }

  ngOnInit() {

  }

  private createProfileImage(base64Image: string): SafeStyle{
    return this.sanitizer.bypassSecurityTrustStyle(`url(data:image/png;base64,${base64Image})`)['changingThisBreaksApplicationSecurity'];
  }

  hideMenu() {
    let body = document.getElementsByTagName('body')[0];

    body.classList.remove('menu-open');
    body.classList.add('menu-close');

  }
}
